.api-information {
  code {
    color: #808080;
    border-radius: 3px;
    background: #fafafa;
    border: solid thin #e6e6e6;
    font-family: Courier, sans-serif;
  }

  pre {
    color: #808080;
    padding: 5px 10px;
    border-radius: 3px;
    background: #fafafa;
    border: solid thin #e6e6e6;
    font-family: Courier, sans-serif;

    code {
      border: none;
    }
  }
}

table {
  width: 100%;
  display: block;
  overflow: hidden;
  max-height: 120px;
  border-radius: 3px;
  border: solid thin #e6e6e6;

  th,
  td {
    padding: 5px 10px;
    word-break: normal;
    white-space: pre-line;
    border: solid thin #e6e6e6;
    text-align: left !important;

    &:first-child {
      border-left: none;
    }

    &:last-child {
      border-right: none;
    }
  }

  tr {
    &:first-child {
      th,
      td {
        border-top: none;
      }
    }

    &:last-child {
      th,
      td {
        border-bottom: none;
      }
    }
  }
}
